CREATE TABLE db.`places` (
      `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
      `name` varchar(255) NOT NULL,
      `area_id` int(10) unsigned NOT NULL,
      `slug` varchar(255) NOT NULL,
      `longtitude` decimal(11,9) NOT NULL,
      `latitude` decimal(11,9) NOT NULL,
      `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
      `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
      PRIMARY KEY (`id`),
      KEY `places_area_id_index` (`area_id`),
      KEY `idx_slug` (`slug`),
      KEY `idx_locations` (`latitude`,`longtitude`),
      CONSTRAINT `places_area_id_foreign` FOREIGN KEY (`area_id`) REFERENCES `areas` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5160;

